import * as types from '../Actions/actionTypes'
const Initialstate = {
    links:[]
}
const menuReducer = (state=Initialstate,action) =>{
    switch(action.type){
        case types.GET_MENU_ITEM:
            return ({...state,links:action.payload})
        default:return
    }
}
export default menuReducer
